
<!DOCTYPE html>
<html>

<body>
    <canvas id='canvas' width='143' height='334'></canvas>
    <script>
    var ctx = document.getElementById("canvas").getContext("2d");
    	
// #layer1
	ctx.save();
	ctx.transform(1.000000, 0.000000, 0.000000, 1.000000, 179.000000, -335.362210);

	ctx.bezierCurveTo(-67.235500, 335.362210, -35.000000, 367.597710, -35.000000, 407.362210);
	ctx.fill();
	
// #path5654
	ctx.beginPath();
	ctx.globalAlpha = 1.0;
	ctx.lineJoin = 'round';
	ctx.lineCap = 'butt';
